import React from "react";
import YoutubePlaylistsCon from "./YoutubePlaylistsCon";
import SpotifyPlaylistsCon from "./SpotifyPlaylistsCon";

const ControlPanel = ({ playlists, handlePlaylistSelect, YoutubePlaylists }) => {
	return (
		<div className="controlPanel">
			<SpotifyPlaylistsCon playlists={playlists} handlePlaylistSelect={handlePlaylistSelect} />
			<YoutubePlaylistsCon YoutubePlaylists={YoutubePlaylists} />
		</div>
	);
};

export default ControlPanel;
